import React, { useState } from "react";
import { useHistory } from "react-router-dom";
import axios from "axios";
import _ from "lodash";
import { useDispatch } from "react-redux";
import setFields from "../actions/inputFields";
import {
  IonContent,
  IonPage,
  IonInput,
  IonItem,
  IonButton,
  IonGrid,
  IonRow,
  IonCol,
  IonLabel,
  IonAlert,
  IonLoading,
  IonImg,
  IonNote,
} from "@ionic/react";

const Organization = () => {
  const dispatch = useDispatch();
  const history = useHistory();
  const [text, setText] = useState("");
  const [myError, setMyError] = useState("");
  const [showAlert, setShowAlert] = useState(false);
  const [showLoading, setShowLoading] = useState(false);

  const onChange = (event) => setText(_.toUpper(event.detail.value));
  const onClick = async () => {
    try {
      setShowLoading(true);
      const res = await axios.get(
        `https://xtreme-id.online/api/form/organization/${text}`
      );
      dispatch(setFields(res));
      setShowLoading(false);

      history.push("/form");
    } catch (err) {
      if (err.response.status === 404) {
        setShowLoading(false);
        setMyError("Organization not found");
        setText("");
        setShowAlert(true);
      } else {
        console.log(err.response);
      }
    }
  };

  const imgsrc =
    "data:image/png;base64,";

  const midsrc =
    "data:image/png;base64,";

  return (
    <IonPage className="ion-padding">
      <IonContent className="ion-padding">
        <IonGrid>
          <div className="ion-text-center ion-margin">
            <IonRow>
              <IonCol>
                <div className="vertical-center">
                  <div>
                    <IonImg className="align-center" src={imgsrc} />
                  </div>
                </div>
              </IonCol>
            </IonRow>

            <IonRow>
              <IonCol>
                <IonLabel>Xtreme ID</IonLabel>
              </IonCol>
            </IonRow>
            <IonRow>
              <IonCol>
                <small>Create your Identity</small>
              </IonCol>
            </IonRow>
            <IonImg src={midsrc} />
          </div>
          <IonRow>
            <IonCol>
              <span>
                Please enter organization code to download application form*
              </span>
            </IonCol>
          </IonRow>
          <IonRow>
            <IonCol>
              <IonItem>
                <IonLabel position="stacked">Organization Code</IonLabel>
                <IonInput
                  autoCapitalize="on"
                  value={text}
                  placeholder="EXAMPLE: C01"
                  onIonChange={(e) => onChange(e)}
                  required
                ></IonInput>
              </IonItem>
            </IonCol>
          </IonRow>
          <IonRow>
            <IonCol>
              <small style={{ color: "gray" }}>
                Get organization code from administrator
              </small>
            </IonCol>
          </IonRow>

          <IonRow>
            <IonCol>
              <IonButton expand="full" onClick={onClick} color="primary">
                LOAD APPLICATION
              </IonButton>
            </IonCol>
          </IonRow>
        </IonGrid>
        <IonAlert
          isOpen={showAlert}
          onDidDismiss={() => setShowAlert(false)}
          cssClass="my-custom-class"
          header={"Error"}
          message={myError}
          buttons={["OK"]}
        />
        <IonLoading
          cssClass="my-custom-class"
          isOpen={showLoading}
          onDidDismiss={() => setShowLoading(false)}
          message={"Please wait..."}
        />
      </IonContent>
    </IonPage>
  );
};

export default Organization;
